import React from "react";
import PostItem from "../../BlogWidget/PostItem";

function PostsList({ posts, isWidget }) {
  console.log(posts);
  return (
    <div>
      {posts &&
        posts.map((post) => {
          return <PostItem key={post.id} isWidget={isWidget} post={post} />;
        })}
    </div>
  );
}

export default PostsList;
